@stephaniedsnow Whew! That is good to know.
We're so sorry that this happened.
Yes, be sure to check it carefully.

@FlyingGumshield Our apologies for the delayed baggage. If you need our help, please send us a direct message with:
● your full name;
● six-letter reservation code;
● where you flew from and to;
● the delayed baggage reference number; and,
● bag tag numbers for missing bags. https://t.co/o7MlHGd5Wh

@happyem Hello Emma, 
We are sorry to hear you have experienced a schedule change. If you could send us a direct message with your full name, email address, and six letter reservation code, and we would be happy to take a look. 

~Kia

@Canadiandisn3rd Generally speaking, middle names aren't required on tickets, even if they show on your passport.
When guests had to upload proof of vaccination to check in, if their QR codes had their middle names, it was best if their tickets matched the QR codes.
Is that maybe what you heard?

@sam_je_suis23 Apologies for your delayed baggage. Could you please send a direct message with your full name, reservation code and/or ticket number and email address, to look into this?
We would also need the claim number.
Thank you
